import React from 'react';

const CalibrationPoint = ({ point, index, handleCalibrationClick }) => {
  return (
    <div
      className="calibration-point"
      style={{ left: point.x, top: point.y, backgroundColor: point.color || 'red' }}
      onClick={(e) => handleCalibrationClick(index, e)}
    />
  );
}

export default CalibrationPoint;
